import React, { useState, useEffect } from 'react';
import axios from 'axios';

const MatchTimeline = ({ matchId }) => {
  const [timelineData, setTimelineData] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [selectedEvent, setSelectedEvent] = useState(null);
  const [timeFilter, setTimeFilter] = useState('all');

  useEffect(() => {
    const fetchTimelineData = async () => {
      try {
        setLoading(true);
        const response = await axios.get(`/api/telemetry/${matchId}/timeline`);
        setTimelineData(response.data);
        setError(null);
      } catch (err) {
        console.error('Error fetching timeline data:', err);
        setError('Failed to load match timeline data');
      } finally {
        setLoading(false);
      }
    };

    if (matchId) {
      fetchTimelineData();
    }
  }, [matchId]);

  if (loading) {
    return <div className="timeline-loading">Loading match timeline...</div>;
  }

  if (error) {
    return <div className="timeline-error">{error}</div>;
  }

  if (!timelineData || !timelineData.data || timelineData.data.length === 0) {
    return <div className="timeline-no-data">No timeline data available</div>;
  }

  // Filter events based on time filter
  const filteredEvents = timelineData.data.filter(event => {
    if (timeFilter === 'all') return true;

    const matchDuration = timelineData.meta.matchDuration || 1800; // Default 30 min if not available
    const maxTime = parseInt(timeFilter, 10) * 60; // Convert minutes to seconds

    return event.secondsFromStart <= maxTime;
  });

  // Group events into phases/time windows
  const timeWindows = [];
  const windowSize = 60; // Group events into 1-minute windows

  for (let i = 0; i < (timelineData.meta.matchDuration || 1800); i += windowSize) {
    const windowEvents = filteredEvents.filter(
      event => event.secondsFromStart >= i && event.secondsFromStart < (i + windowSize)
    );

    if (windowEvents.length > 0) {
      timeWindows.push({
        startTime: i,
        endTime: i + windowSize,
        events: windowEvents
      });
    }
  }

  // Helper function to format time
  const formatTime = (seconds) => {
    const mins = Math.floor(seconds / 60);
    const secs = Math.floor(seconds % 60);
    return `${mins}:${secs < 10 ? '0' : ''}${secs}`;
  };

  // Helper function to get event icon
  const getEventIcon = (eventType) => {
    switch (eventType) {
      case 'kill':
        return '☠️';
      case 'knockdown':
        return '🔫';
      case 'circle':
        return '⭕';
      case 'carepackage':
        return '📦';
      default:
        return '•';
    }
  };

  return (
    <div className="match-timeline-container">
      <h3>Match Timeline</h3>

      <div className="timeline-controls">
        <div className="time-filter">
          <label htmlFor="timeFilter">Show events up to: </label>
          <select 
            id="timeFilter"
            value={timeFilter}
            onChange={(e) => setTimeFilter(e.target.value)}
          >
            <option value="all">All events</option>
            <option value="5">First 5 minutes</option>
            <option value="10">First 10 minutes</option>
            <option value="15">First 15 minutes</option>
            <option value="20">First 20 minutes</option>
            <option value="25">First 25 minutes</option>
            <option value="30">First 30 minutes</option>
          </select>
        </div>
      </div>

      <div className="timeline-visualization">
        {/* Timeline axis */}
        <div className="timeline-axis">
          {timeWindows.map((window, idx) => (
            <div key={idx} className="timeline-marker">
              <span className="time-label">{formatTime(window.startTime)}</span>
            </div>
          ))}
          {timelineData.meta.matchDuration && (
            <div className="timeline-marker timeline-end">
              <span className="time-label">{formatTime(timelineData.meta.matchDuration)}</span>
            </div>
          )}
        </div>

        {/* Timeline events */}
        <div className="timeline-events">
          {timeWindows.map((window, windowIdx) => (
            <div key={windowIdx} className="timeline-window">
              <div className="window-events">
                {window.events.map((event, eventIdx) => (
                  <div 
                    key={eventIdx}
                    className={`timeline-event event-${event.type} ${selectedEvent === event ? 'selected' : ''}`}
                    style={{
                      left: `${((event.secondsFromStart - window.startTime) / windowSize) * 100}%`
                    }}
                    onClick={() => setSelectedEvent(event === selectedEvent ? null : event)}
                    title={`${formatTime(event.secondsFromStart)} - ${event.type}`}
                  >
                    {getEventIcon(event.type)}
                  </div>
                ))}
              </div>
            </div>
          ))}
        </div>
      </div>

      {/* Event details panel */}
      {selectedEvent && (
        <div className="event-details-panel">
          <h4>{formatTime(selectedEvent.secondsFromStart)} - {selectedEvent.type.toUpperCase()}</h4>

          {selectedEvent.type === 'kill' && (
            <div className="kill-details">
              <p><strong>Killer:</strong> {selectedEvent.data.killerName || 'Unknown'}</p>
              <p><strong>Victim:</strong> {selectedEvent.data.victimName || 'Unknown'}</p>
              <p><strong>Weapon:</strong> {selectedEvent.data.damageCauserName || 'Unknown'}</p>
            </div>
          )}

          {selectedEvent.type === 'knockdown' && (
            <div className="knockdown-details">
              <p><strong>Attacker:</strong> {selectedEvent.data.attackerName || 'Unknown'}</p>
              <p><strong>Victim:</strong> {selectedEvent.data.victimName || 'Unknown'}</p>
              <p><strong>Weapon:</strong> {selectedEvent.data.damageCauserName || 'Unknown'}</p>
            </div>
          )}

          {selectedEvent.type === 'circle' && (
            <div className="circle-details">
              <p><strong>Phase:</strong> {selectedEvent.data.phase || 0}</p>
              <p><strong>Players Alive:</strong> {selectedEvent.data.numAlivePlayers || 0}</p>
              <p><strong>Teams Alive:</strong> {selectedEvent.data.numAliveTeams || 0}</p>
              <p><strong>Circle Radius:</strong> {Math.round(selectedEvent.data.radius || 0)}m</p>
            </div>
          )}

          {selectedEvent.type === 'carepackage' && (
            <div className="carepackage-details">
              <p><strong>Care Package</strong></p>
              {selectedEvent.data.items && selectedEvent.data.items.length > 0 ? (
                <ul className="item-list">
                  {selectedEvent.data.items.map((item, i) => (
                    <li key={i}>{item.itemId?.split('_').pop() || item.itemId || 'Unknown item'}</li>
                  ))}
                </ul>
              ) : (
                <p>No items found</p>
              )}
            </div>
          )}

          <button 
            className="close-details-btn"
            onClick={() => setSelectedEvent(null)}
          >
            Close
          </button>
        </div>
      )}

      <div className="timeline-legend">
        <div className="legend-item">
          <span className="legend-icon kill-icon">☠️</span>
          <span className="legend-label">Kill</span>
        </div>
        <div className="legend-item">
          <span className="legend-icon knockdown-icon">🔫</span>
          <span className="legend-label">Knockdown</span>
        </div>
        <div className="legend-item">
          <span className="legend-icon circle-icon">⭕</span>
          <span className="legend-label">Circle Change</span>
        </div>
        <div className="legend-item">
          <span className="legend-icon carepackage-icon">📦</span>
          <span className="legend-label">Care Package</span>
        </div>
      </div>
    </div>
  );
};

export default MatchTimeline;
